// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./MediaLibrary.sol";

contract PriviNFT is ERC721, ERC721URIStorage, ERC721Pausable, AccessControl {
    using Counters for Counters.Counter;
    using MediaLibrary for Media;

    Counters.Counter private _tokenIds;

    mapping(uint256 => Media) private _medias;

    // admins can pause the contract and mint tokens
    bytes32 public constant ADMIN = keccak256("admin");
    // media admin can create media
    // (this is to ensure only media manager can create to set correct collabs)
    bytes32 public constant MEDIA_ADMIN = keccak256("media_admin");
    bytes32 public constant MEDIA_FRACTIONALIZE_ADMIN = keccak256("media_fractionalize_admin");
    bytes32 public constant MEDIA_UPDATE_ADMIN = keccak256("media_update_admin");

    constructor(string memory name_, string memory symbol_) ERC721(name_, symbol_) {
        // The super admin is the deployer
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN, msg.sender);
    }

    // this function emits a transfer event
    function createMedia(Media memory _media, string memory _tokenURI)
        public
        onlyRole(MEDIA_ADMIN)
        returns (uint256)
    {
        require(_media.royalty < MediaLibrary.SHARES_DENOMINATOR, "Invalid royalty");
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(_media, newItemId);
        _setTokenURI(newItemId, _tokenURI);

        // only for contract calls
        return newItemId;
    }

    // media struct getter by id
    function getMedia(uint256 _tokenId) external view onlyRole(ADMIN) returns (Media memory) {
        Media memory media = _medias[_tokenId];
        require(media.creatorAddress != address(0), "Query for nonexistent token");
        return media;
    }

    // only the media manager can update the media
    function updateMediaCollabsSize(uint256 _tokenId, uint256 _collabsSize) external onlyRole(MEDIA_ADMIN) {
        _medias[_tokenId].collabsSize = uint80(_collabsSize);
    }

    // only the media manager can update the media
    function updateMediaOwnersSize(uint256 _tokenId, uint256 _ownersSize)
        external
        onlyRole(MEDIA_FRACTIONALIZE_ADMIN)
    {
        _medias[_tokenId].ownersSize = uint80(_ownersSize);
    }

    // only the manager can update the media
    function updateMedia(UpdateMediaRequest memory _updateMediaRequest)
        external
        onlyRole(MEDIA_UPDATE_ADMIN)
    {
        Media memory media = _medias[_updateMediaRequest.mediaId];
        require(media.creatorAddress != address(0), "Update for nonexistent token");

        media.royalty = uint80(_updateMediaRequest.royalty);
        media.mediaName = _updateMediaRequest.mediaName;
        media.mediaType = _updateMediaRequest.mediaType;

        _medias[_updateMediaRequest.mediaId] = media;
    }

    function creatorOf(uint256 _tokenId) public view virtual returns (address) {
        address creator = _medias[_tokenId].creatorAddress;
        require(creator != address(0), "Creator query for nonexistent token");
        return creator;
    }

    function tokenURI(uint256 _tokenId)
        public
        view
        virtual
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return ERC721URIStorage.tokenURI(_tokenId);
    }

    function pause() external onlyRole(ADMIN) {
        _pause();
    }

    function unpause() external onlyRole(ADMIN) {
        _unpause();
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(AccessControl, ERC721)
        returns (bool)
    {
        return AccessControl.supportsInterface(interfaceId) || ERC721.supportsInterface(interfaceId);
    }

    function _mint(Media memory _media, uint256 _tokenId) internal virtual {
        _mint(_media.creatorAddress, _tokenId);
        _medias[_tokenId] = _media;
    }

    function _burn(uint256) internal virtual override(ERC721, ERC721URIStorage) {
        revert("Can't burn tokens");
    }

    function _beforeTokenTransfer(
        address _from,
        address _to,
        uint256 _tokenId
    ) internal virtual override(ERC721, ERC721Pausable) {
        ERC721Pausable._beforeTokenTransfer(_from, _to, _tokenId);
    }
}
